import React from 'react';

class AddProject extends React.Compponent {
  constructor(props) {
    super(props);
  }
  static defaultProps = {
    categories: ['Web Design', 'Web Development', 'Mobile Development']
  }    

  render() {
    let categoryOptions = this.props.categories.map(category => {
      return <option value={category} name={category}>{category}</option>
    });

    return (  
      <div>
        <h3>Add Projects</h3>
        <form>
          <div>
            <label>Title</label>
            <input type='text' name='input' />
          </div>
          <div>
            <label>Category</label>
            <select name='category'>
              {categoryOptions}
            </select>
          </div>
        </form>
      </div>
    );  
  }  	

}

export default AddProject;
